--PRAGMA foreign_keys=ON;
BEGIN TRANSACTION;
DROP TABLE IF EXISTS posts;
CREATE TABLE posts (
	    id INTEGER PRIMARY KEY,
		title VARCHAR,
		text VARCHAR,
		community VARCHAR,
		url VARCHAR,
		username VARCHAR, 
		date VARCHAR,
		
		upvotes INTEGER,
		downvotes INTEGER,
		score INTEGER
		
		-- UNIQUE(title, community, username)
	);

DROP TABLE IF EXISTS vote_tracker;
CREATE TABLE vote_tracker (
		id INTEGER PRIMARY KEY,
		post_id INTEGER,
		vote_type VARCHAR,
		FOREIGN KEY(post_id) REFERENCES posts(id)
	);

COMMIT;